import React from "react";
const Layout2 = () => {
  return (
    <div>
      <div className="container center">
      <div className="item">
        Làm ny tớ nhé! 
      </div>
      <div className="heart-shape"></div>
      </div>
    </div>
  );
};
export default React.memo(Layout2);
